import React from 'https://cdn.jsdelivr.net/npm/react@18.2.0/+esm';
import ReactDOM from 'https://cdn.jsdelivr.net/npm/react-dom@18.2.0/+esm';

function MapWidget() {

    const latitude = appsmith.model.latitude || 40.7128; // Default latitude
    const longitude = appsmith.model.longitude || -74.0060; // Default longitude

    React.useEffect(() => {
        const map = L.map('map').setView([latitude, longitude], 13);

        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            maxZoom: 19,
            attribution: '© OpenStreetMap'
        }).addTo(map);

        L.marker([latitude, longitude]).addTo(map)
            .bindPopup('Selected Position')
            .openPopup();

        return () => {
            map.off();
            map.remove();
        };
    }, [latitude, longitude]);

    return <div id="map" style={{ height: "100vh" }}></div>;
}

appsmith.onReady(() => {
    ReactDOM.render(<MapWidget />, document.getElementById('root'));
});
